import React from 'react'
import { useParams } from 'react-router-dom'
import ReviewList from './ReviewList'

const ReviewPage = ({episodeNumReviewPage}) => {

    const id = useParams();

  return (
    <div>
        <ReviewList id={id} episodeNumReviewPage={episodeNumReviewPage}/>
    </div>
  )
}

export default ReviewPage
